import React, { useEffect } from "react";
import { useAudioContext } from "../AudioContext";
import "./AudioList.css";

const AudioList = () => {
  const {
    setCurrentTrack,
    isPlaying,
    togglePlay,
    setIsPlaying,
    currentTrackIndex,
    setCurrentTrackIndex,
    updateAudioFiles,
    audioFiles,
    audioRef,
  } = useAudioContext();

  useEffect(() => {
    if (currentTrackIndex === -1) {
      fetch("http://localhost:8080/api/audio", { method: "GET" })
        .then((response) => response.json())
        .then(async (data) => {
          // Загрузка данных аудиофайлов
          await Promise.all(
            data.map(async (audioFile) => {
              // Загрузка аудиофайла
              const audioResponse = await fetch(
                `http://localhost:8080/api/audio/${audioFile.id}`
              );
              if (!audioResponse.ok) {
                throw new Error(`HTTP error! status: ${audioResponse.status}`);
              }
              const audioBlob = await audioResponse.blob();
              const audioData = URL.createObjectURL(new Blob([audioBlob]));

              // Загрузка изображения
              const imageResponse = await fetch(
                `http://localhost:8080/api/audio/${audioFile.id}/image`
              );
              if (!imageResponse.ok) {
                throw new Error(`HTTP error! status: ${imageResponse.status}`);
              }
              const imageBlob = await imageResponse.blob();
              const imageData = URL.createObjectURL(new Blob([imageBlob]));

              return {
                ...audioFile,
                audioUrl: audioData,
                imageUrl: imageData,
              };
            })
          );
          updateAudioFiles(data);
        })
        .catch((error) => console.error("Error fetching data:", error));
    }
  }, [isPlaying]);

  const handleTogglePlay = () => {
    if (isPlaying) {
      audioRef.current.pause(); // Пауза воспроизведения
    } else {
      audioRef.current.play(); // Возобновление воспроизведения
    }
    togglePlay(); // Переключение состояния воспроизведения
  };

  const handlePlayAudio = async (audioFile, index) => {
    console.log(index + " : " + currentTrackIndex);
    if (currentTrackIndex === index) {
      handleTogglePlay();
    } else {
      try {
        const audioResponse = await fetch(
          `http://localhost:8080/api/audio/${audioFile.id}`
        );
        if (!audioResponse.ok) {
          throw new Error(`HTTP error! status: ${audioResponse.status}`);
        }
        const audioBlob = await audioResponse.blob();
        const audioData = URL.createObjectURL(new Blob([audioBlob]));

        const imageResponse = await fetch(
          `http://localhost:8080/api/audio/${audioFile.id}/image`
        );
        if (!imageResponse.ok) {
          throw new Error(`HTTP error! status: ${imageResponse.status}`);
        }
        const imageBlob = await imageResponse.blob();
        const imageData = URL.createObjectURL(new Blob([imageBlob]));

        setCurrentTrackIndex(index);
        setCurrentTrack({
          id: audioFile.id,
          audioUrl: audioData,
          trackName: audioFile.title,
          author: audioFile.author,
          imageUrl: imageData,
          duration: audioFile.duration,
        });
        setIsPlaying(true); // Устанавливаем флаг воспроизведения, чтобы воспроизвести трек
      } catch (error) {
        console.error("Error fetching audio:", error);
      }
    }
  };

  function formatDuration(duration) {
    const hours = Math.floor(duration / 3600);
    const minutes = Math.floor((duration % 3600) / 60);
    const seconds = Math.floor(duration % 60);

    let formattedTime = "";
    if (hours > 0) {
      formattedTime += hours + ":";
    }
    if (hours > 0 && minutes < 10) {
      formattedTime += "0";
    }
    formattedTime += String(minutes).padStart(hours > 0 ? 2 : 1, "0") + ":";
    formattedTime += String(seconds).padStart(2, "0");

    return formattedTime;
  }

  return (
    <div className="audio-list">
      <ul>
        {audioFiles.map((audioFile, index) => (
          <li key={audioFile.id}>
            <div className="audio-metadata-container">
              {audioFile.imageUrl && (
                <img src={audioFile.imageUrl} alt={audioFile.title} />
              )}
              <div className="button-container">
                <button
                  className="play_pause"
                  onClick={() => handlePlayAudio(audioFile, index)}
                >
                  {currentTrackIndex === index && isPlaying ? "||" : ">"}
                </button>
              </div>
              <div className="title-author-container">
                <span className="title">{audioFile.title}</span>
                <span>{audioFile.author}</span>
              </div>
              <div className="duration-container">
                <span className="duration">
                  {formatDuration(audioFile.duration)}
                </span>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AudioList;
